model_compressed = b''

NUM_CHANNELS = 64


class Connect4Model(nn.Module):
    def __init__(self):
        # game params
        self.board_x, self.board_y = 6, 7
        self.action_size = 7

        super(Connect4Model, self).__init__()
        self.conv1 = nn.Conv2d(1, NUM_CHANNELS, 3, stride=1, padding=1)
        self.conv2 = nn.Conv2d(
            NUM_CHANNELS, NUM_CHANNELS, 3, stride=1, padding=1)
        self.conv3 = nn.Conv2d(
            NUM_CHANNELS, NUM_CHANNELS, 3, stride=1)
        self.conv4 = nn.Conv2d(
            NUM_CHANNELS, NUM_CHANNELS, 3, stride=1)

        self.bn1 = nn.BatchNorm2d(NUM_CHANNELS)
        self.bn2 = nn.BatchNorm2d(NUM_CHANNELS)
        self.bn3 = nn.BatchNorm2d(NUM_CHANNELS)
        self.bn4 = nn.BatchNorm2d(NUM_CHANNELS)

        self.fc1 = nn.Linear(
            NUM_CHANNELS * (self.board_x - 4) * (self.board_y - 4), 128)
        self.fc_bn1 = nn.BatchNorm1d(128)

        self.fc2 = nn.Linear(128, 64)
        self.fc_bn2 = nn.BatchNorm1d(64)

        self.fc3 = nn.Linear(64, self.action_size)

    def forward(self, s):
        # s: batch_size x board_x x board_y
        s = s.view(-1, 1, self.board_x,
                   self.board_y).float()  # batch_size x 1 x board_x x board_y
        s = F.relu(self.bn1(
            self.conv1(s)))  # batch_size x num_channels x board_x x board_y
        s = F.relu(self.bn2(
            self.conv2(s)))  # batch_size x num_channels x board_x x board_y
        s = F.relu(self.bn3(self.conv3(
            s)))  # batch_size x num_channels x (board_x-2) x (board_y-2)
        s = F.relu(self.bn4(self.conv4(
            s)))  # batch_size x num_channels x (board_x-4) x (board_y-4)
        s = s.view(-1, NUM_CHANNELS * (self.board_x - 4) * (self.board_y - 4))

        s = F.relu(self.fc_bn1(self.fc1(s))) # batch_size x 128
        s = F.relu(self.fc_bn2(self.fc2(s))) # batch_size x 64

        pi = self.fc3(s)  # batch_size x action_size

        return F.log_softmax(pi, dim=0)

# https://www.kaggle.com/c/connectx/discussion/128591
def create_model(model_params):
    torch_mlp = Connect4Model()
    
    # Could differ on different systems! Matches generated torch layer names to stable baselines names
    layer_name_lookup = {
        'conv1.weight': 'model/conv2d/kernel:0', 
        'conv1.bias': 'model/conv2d/bias:0',
        'conv2.weight': 'model/conv2d_1/kernel:0',
        'conv2.bias': 'model/conv2d_1/bias:0', 
        'conv3.weight': 'model/conv2d_2/kernel:0',
        'conv3.bias': 'model/conv2d_2/bias:0',
        'conv4.weight': 'model/conv2d_3/kernel:0',
        'conv4.bias': 'model/conv2d_3/bias:0',
        'bn1.weight': 'model/batch_normalization/gamma:0',
        'bn1.bias': 'model/batch_normalization/beta:0',
        'bn2.weight': 'model/batch_normalization_1/gamma:0',
        'bn2.bias': 'model/batch_normalization_1/beta:0',
        'bn3.weight': 'model/batch_normalization_2/gamma:0',
        'bn3.bias': 'model/batch_normalization_2/beta:0',
        'bn4.weight': 'model/batch_normalization_3/gamma:0',
        'bn4.bias': 'model/batch_normalization_3/beta:0',
        'fc1.weight': 'model/dense/kernel:0',
        'fc1.bias': 'model/dense/bias:0',
        'fc_bn1.weight': 'model/batch_normalization_4/gamma:0',
        'fc_bn1.bias': 'model/batch_normalization_4/beta:0',
        'fc2.weight': 'model/dense_1/kernel:0',
        'fc2.bias': 'model/dense_1/bias:0',
        'fc_bn2.weight': 'model/batch_normalization_5/gamma:0',
        'fc_bn2.bias': 'model/batch_normalization_5/beta:0',
        'fc3.weight': 'model/dense_2/kernel:0',
        'fc3.bias': 'model/dense_2/bias:0'
    }

    for (th_key, pytorch_param) in torch_mlp.named_parameters():
        parameter_array = torch.from_numpy(model_params[layer_name_lookup[th_key]])
        #Copies parameters from baselines model to pytorch model
        #print(th_key, layer_name_lookup[th_key])
        #print(pytorch_param.shape, parameter_array.shape)
        pytorch_param.data.copy_(parameter_array.data.clone().T)

    return torch_mlp



def decompressAndDeserialize(compressedData):
    d_data_byte = b64.b64decode(compressedData)
    data_byte = zlib.decompress(d_data_byte)
    value = pickle.loads(data_byte)
    return value



# Making sure we are always playing mark 1
def board_flip(mark, board):
    if mark == 1:
        return board

    for i in range(board.shape[0]):
        for j in range(board.shape[1]):
            if board[i, j, 0] != 0:
                board[i, j, 0] = board[i, j, 0]%2 + 1

    return board

model = create_model(decompressAndDeserialize(model_compressed))
model.eval()

def agent(obs, config):
    # Use the best model to select a column
    grid = board_flip(obs.mark, np.array(obs['board']).reshape(6,7,1))
    col = model.forward(torch.from_numpy(grid))
    move = col.argmax().item()
    # Check if selected column is valid
    is_valid = (obs['board'][move] == 0)
    # If not valid, select random move. 
    if is_valid:
        return move
    
    return random.choice([col for col in range(config.columns) if obs.board[int(col)] == 0])

